import React from 'react';
import { useHistory } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { setColorScheme } from '../colorSchemeSlice';

const SettingsPage = () => {
  const history = useHistory();
  const dispatch = useDispatch();
  const colorScheme = useSelector((state) => state.colorScheme);
        
               
          const handleSchemeChange = (scheme) => {
            switch (scheme) {
              case 'scheme1':
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '#a2f5a2',
                    primaryColor: '#007bff',
                    secondaryColor: '#6c757d',
                    fontSize: '16px',
                    fontColor: '#333', 
                  },
                });
                break;
              case 'scheme2':
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '#743bfa',
                    primaryColor: '#4caf50',
                    secondaryColor: '#607d8b',
                    fontSize: '18px',
                    fontColor: '#222',
                  },
                });
                break;
              case 'scheme3':
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '#249beb',
                    primaryColor: '#9c27b0',
                    secondaryColor: '#2196f3',
                    fontSize: '14px',
                    fontColor: '#555',
                  },
                });
                break;
              case 'scheme4':
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '#f334da',
                    primaryColor: '#ff5722',
                    secondaryColor: '#795548',
                    fontSize: '20px',
                    fontColor: '#111',
                  },
                });
                break;
              case 'scheme5':
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '#c5f124',
                    primaryColor: '#e91e63',
                    secondaryColor: '#00bcd4',
                    fontSize: '22px',
                    fontColor: '#444',
                  },
                });
                break;
              default:
                dispatch({
                  type: 'SET_COLOR_SCHEME',
                  payload: {
                    backgroundColor: '',
                    primaryColor: '',
                    secondaryColor: '',
                    fontSize: '',
                    fontColor: '',
                  },
                });
            }
        
            
          };
        
          return (
            <div>
              <header className="header">Header</header>
              <div className="content">
                <h1>Settings</h1>
                <div className="color-scheme-buttons">
                  <button
                    className={`color-scheme-btn ${
                      colorScheme.backgroundColor === '#a2f5a2' ? 'active' : ''
                    }`}
                    style={{ backgroundColor: '#a2f5a2' }}
                    onClick={() => handleSchemeChange('scheme1')}
                    />
                    <button
                      className={`color-scheme-btn ${
                        colorScheme.backgroundColor === '#743bfa' ? 'active' : ''
                      }`}
                      style={{ backgroundColor: '#743bfa' }}
                      onClick={() => handleSchemeChange('scheme2')}
                    />
                    <button
                      className={`color-scheme-btn ${
                        colorScheme.backgroundColor === '#249beb' ? 'active' : ''
                      }`}
                      style={{ backgroundColor: '#249beb' }}
                      onClick={() => handleSchemeChange('scheme3')}
                    />
                    <button
                      className={`color-scheme-btn ${
                        colorScheme.backgroundColor === '#f334da' ? 'active' : ''
                      }`}
                      style={{ backgroundColor: '#f334da' }}
                      onClick={() => handleSchemeChange('scheme4')}
                    />
                    <button
                      className={`color-scheme-btn ${
                        colorScheme.backgroundColor === '#c5f124' ? 'active' : ''
                      }`}
                      style={{ backgroundColor: '#c5f124' }}
                      onClick={() => handleSchemeChange('scheme5')}
                    />
                  </div>
                  <label>
                    Background Color:
                    <input
                      type="color"
                      value={colorScheme.backgroundColor}
                      onChange={(e) =>
                        dispatch({
                          type: 'SET_COLOR_SCHEME',
                          payload: {
                            ...colorScheme,
                            backgroundColor: e.target.value,
                          },
                        })
                      }
                    />
                  </label>
                  <label>
                    Primary Color:
                    <input
                      type="color"
                      value={colorScheme.primaryColor}
                      onChange={(e) =>
                        dispatch({
                          type: 'SET_COLOR_SCHEME',
                          payload: {
                            ...colorScheme,
                            primaryColor: e.target.value,
                          },
                        })
                      }
                    />
                  </label>
                  <label>
                    Secondary Color:
                    <input
                      type="color"
                      value={colorScheme.secondaryColor}
                      onChange={(e) =>
                        dispatch({
                          type: 'SET_COLOR_SCHEME',
                          payload: {
                            ...colorScheme,
                            secondaryColor: e.target.value,
                          },
                        })
                      }
                    />
                  </label>
                  <label>
                    Font Size:
                    <input
                      type="number"
                      min="12"
                      max="24"
                      value={colorScheme.fontSize}
                      onChange={(e) =>
                        dispatch({
                          type: 'SET_COLOR_SCHEME',
                          payload: {
                            ...colorScheme,
                            fontSize: e.target.value,
                          },
                        })
                      }
                    />
                  </label>
                  <label>
                    Font Color:
                    <input
                      type="color"
                      value={colorScheme.fontColor}
                      onChange={(e) =>
                        dispatch({
                          type: 'SET_COLOR_SCHEME',
                          payload: {
                            ...colorScheme,
                            fontColor: e.target.value,
                          },
                        })
                      }
                    />
                  </label>
                </div>
                <footer className="footer">Footer</footer>
              </div>
          )
        }              
        


export default SettingsPage;
